import React from "react";
import Header from "./Header";
import HobbyList from "./HobbyList";
import ActivityList from "./ActivityList";
// import "./App.css";

/*
   TODO: Add HobbyList and ActivityList
*/

function App() {
  const name = "Kitty Kat";
  const birthday = "January 1";
  const imageSrc =
    "https://images.pexels.com/photos/45201/kitty-cat-kitten-pet-45201.jpeg";
  const listOfHobbies = ["watching birds", "hiding in a box", "napping"];
  const dailyActivities = [
    { time: "8:00 am", description: "wake up" },
    { time: "8:30 am", description: "breakfast" },
    { time: "9:00 am", description: "morning nap" },
    { time: "12:00 pm", description: "lunch" },
    { time: "1:00 pm", description: "afternoon nap" },
    { time: "6:00 pm", description: "dinner" },
    { time: "7:00 pm", description: "play" },
    { time: "10:00 pm", description: "bedtime" },
  ];

  const groceryList = [
    {quantity: 1, item: "brisket"},
    {quantity: 2, item: "salsa"},
    {quantity: 3, item: "chips"}
  ]

  function GroceryList({ items }) {
    const rows = items.map(({quantity, item}, index) => 
      <tr>
        <td>{quantity}</td>
        <td>{item}</td>
      </tr>
    )
  }

  return (
    <div className="App">
      <Header name={name} birthday={birthday} imageSrc={imageSrc} />
      <HobbyList hobbies={listOfHobbies} />
      <ActivityList activities={dailyActivities} style={{border: solid, black}}/>
    </div>
  );
}

export default App;
